import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({ questions, question,index, getQuestionId, id }){

    return(

        <Paper
            key={index}
        >
            <h1>Detail's page</h1>
            <p>{question.category}</p>

        </Paper>
    )
}


export default Question;
